import React, { useEffect, useState } from "react";
import axios from "axios";
import "./StudentProfile.css";

const StudentProfile = () => {
  const [profileData, setProfileData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    // Fetch the student profile data from the backend
    const fetchProfileData = async () => {
      try {
        const response = await axios.get("/api/student-profile");
        setProfileData(response.data); // Assuming the API returns the student profile data
      } catch (err) {
        setError("Failed to load profile data. Please try again later.");
        console.error(err);
      } finally {
        setLoading(false);
      }
    };

    fetchProfileData();
  }, []);

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div className="error-message">{error}</div>;
  }

  return (
    <div className="profile-container">
      <div className="profile-card">
        <div className="profile-image-container">
          <img
            src={profileData?.image || "https://via.placeholder.com/100"}
            alt="Profile"
            className="profile-image"
          />
        </div>
        <h2 className="profile-username">{profileData?.name || "N/A"}</h2>
        <p className="profile-role">Student</p>
        <div className="profile-details">
          <p>
            <strong>Name:</strong> {profileData?.name || "N/A"}
          </p>
          <p>
            <strong>Email:</strong> {profileData?.email || "N/A"}
          </p>
          <p>
            <strong>Registration No:</strong> {profileData?.studentid || "N/A"}
          </p>
          <p>
            <strong>Department:</strong> {profileData?.branch || "N/A"}
          </p>
          <p>
            <strong>Phone Number:</strong> {profileData?.phoneno || "N/A"}
          </p>
        </div>
      </div>
    </div>
  );
};

export default StudentProfile;
